result:
	.shareArea{
		width: 320px;
		align-items: center;
		background: #fff;
		border-radius: 4px;
         .shareTitle{
            border-bottom: 1px solid #e8e8e8;
            padding: 10px;
            box-sizing: border-box;
            width: 100%;
            font-size:14px;
        }
		.bottom{
			align-items: center;
			width: 100%;
			height: 100%;
			box-sizing: border-box;
			padding: 20px 10px;
			.title{
				padding: 10px;
				box-sizing: border-box;
				width: 100%;
				font-size:14px;
			}
			.shareUl{
				justify-content: space-between;
				align-items: center;
				width: 100%;
				padding: 0 10px;
				box-sizing: border-box;
				li{
						display: flex;
						flex-direction: column;
						align-items: center;
						position: relative;
						cursor: pointer;
						.item{
							background: #EFF2F7;
							width: 40px;
							height: 40px;
							border-radius: 50%;
							display: flex;
							justify-content: center;
							align-items: center;
							.svg-icon{
								font-size: 24px;
							}
							.active{
								color:#FF6C60;
							}
						}
						.moreBtn{
							position: relative;
							font-size:14px;
							width:auto;
							height:40px;
							text-align: center;
							padding: 4px 18px;
							border-radius:50px;
							border: 1px solid #dcdcdc;
						}
						.qrcodeArea{
							position: absolute;
							top: 50px;
							left: -30px;
							text-align: center;
							border: 1px solid #a9d86e;
							border-radius: 4px;
							padding: 10px;
							background: #fff;
							.saoTitle{
								font-size: 14px;
								color:#a9d86e;
								margin-bottom: 5px;
							}
						}
				}
			}
			.shareIntro{
			    padding: 10px;
				box-sizing: border-box;
				width: 100%;
				font-size:12px;
			}
		}

	}
